import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import doctor from './doctor(2).png'
import patient from './patient(1).png'
import log from './log2.png'
// import App from './App';
import reportWebVitals from './reportWebVitals';

function Login(){
  return(  
    <div className='main'>
   <div className='logo'>
    <img src={log} alt="log" className='log' />
    <h1>MEDIsync</h1>

   </div>
   <div className='loginarea'>
    <div className='logon'>
      <div className='switch'>
        <button className='s' id='doctor'><img src={doctor} alt="doctor" className='doc'/><p>Doctor</p></button>
        <button className='s' id='patient'><img src={patient} alt="patient" className='pat'/><p>Patient</p></button>
      </div>
      <h1 className='login'>Login</h1>
      <div className='data'>
      <input type="text" placeholder='email'/>
      <br />
      <input type="number" placeholder='Application no'/>
      </div>
      <button className='submit'>Login</button>
      <p className='register'>Not yet Registered?</p>
    </div>
   </div>
    </div>
  )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Login />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
